import { UserMenu } from "../../UserArea/UserMenu/UserMenu";
import "./Header.css";

function Header(): JSX.Element {
    return (
        <div className="Header">
            <img src="../.." alt="Vacations Logo" style={{ width: '150px', height: 'auto' }} />
            <h3>Vacations Project</h3>
            <UserMenu />
        </div>
    );
}

export default Header;
